$(document).ready(function(){$("[data-bs-hover-animate]").mouseenter(function(){var e=$(this);e.addClass("animated "+e.attr("data-bs-hover-animate"))}).mouseleave(function(){var e=$(this);e.removeClass("animated "+e.attr("data-bs-hover-animate"))})}),$(document).ready(function(){function e(){alert("You clicked the subscribe button!")}document.getElementById("subscribeBtn").addEventListener("click",e)});